import React from 'react'
import {photos} from './post'
const Body = () => {
  return (
    <div>
        {
          photos.map((e, i) => (
            <div key={i} id='card' >
              <h3>{e.title} </h3>
              <img src={e.url} alt="descriptive text"/>
            </div>
          ))
        }
    </div>
  )
}

export default Body
